import React, { useState, useEffect } from "react";
import "./Players.css";

const Players = () => {
  const [players, setPlayers] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [loading, setLoading] = useState(true);
  const [favorites, setFavorites] = useState([]);

  const playersPerPage = 50;
  const paginationGroupSize = 10;

  useEffect(() => {
    // Backend hazır değilse manuel örnek oyuncuları kullan
    const fetchPlayers = async () => {
      setLoading(true);
      try {
        // Örnek oyuncu verileri
        const examplePlayers = Array.from({ length: 8000 }, (_, i) => ({
          id: i + 1,
          name: `Player ${i + 1}`,
          club: `Club ${Math.ceil((i + 1) / 50)}`,
          position: ["GK", "DEF", "MID", "ATT"][i % 4],
          rating: Math.floor(Math.random() * 100) + 1,
          wage: `${Math.floor(Math.random() * 20000) + 5000} $`,
          contractUntil: `202${Math.floor(Math.random() * 5) + 3}`,
          image: null, // Görsel yok
        }));

        // Sayfalama için mevcut sayfadaki oyuncuları filtrele
        const startIndex = (currentPage - 1) * playersPerPage;
        const endIndex = startIndex + playersPerPage;
        const paginatedPlayers = examplePlayers.slice(startIndex, endIndex);

        setPlayers(paginatedPlayers);
        setLoading(false);
      } catch (error) {
        console.error("Error fetching players:", error);
        setLoading(false);
      }
    };

    fetchPlayers();
  }, [currentPage]);

  // Favorilere oyuncu ekleme
  const handleAddToFavorites = (player) => {
    if (!favorites.some((fav) => fav.id === player.id)) {
      setFavorites([...favorites, player]);
    }
  };

  const totalPages = Math.ceil(8000 / playersPerPage); // Toplam sayfa sayısı

  const paginate = (pageNumber) => {
    if (pageNumber > 0 && pageNumber <= totalPages) setCurrentPage(pageNumber);
  };

  const currentPaginationGroup = Math.floor((currentPage - 1) / paginationGroupSize);
  const startPage = currentPaginationGroup * paginationGroupSize + 1;
  const endPage = Math.min(startPage + paginationGroupSize - 1, totalPages);

  const goToPreviousGroup = () => {
    const previousGroupStart = startPage - paginationGroupSize;
    if (previousGroupStart > 0) {
      setCurrentPage(previousGroupStart);
    }
  };

  const goToNextGroup = () => {
    const nextGroupStart = startPage + paginationGroupSize;
    if (nextGroupStart <= totalPages) {
      setCurrentPage(nextGroupStart);
    }
  };

  if (loading) {
    return <div className="loading">Loading players...</div>;
  }

  return (
    <div className="players-page">
      <main className="players-list">
        <h1>Players</h1>
        <table>
          <thead>
            <tr>
              <th>Photo</th>
              <th>Name</th>
              <th>Club</th>
              <th>Position</th>
              <th>Rating</th>
              <th>Wage</th>
              <th>Contract</th>
            </tr>
          </thead>
          <tbody>
            {players.map((player) => (
              <tr key={player.id}>
                <td>
                  <button
                    className="favorite-btn"
                    onClick={() => handleAddToFavorites(player)}
                  >
                    ⭐
                  </button>
                </td>
                <td>{player.image ? <img src={player.image} alt={player.name} className="player-photo" /> : "No Image"}</td>
                <td>{player.name}</td>
                <td>{player.club}</td>
                <td>{player.position}</td>
                <td>{player.rating}</td>
                <td>{player.wage}</td>
                <td>{player.contractUntil}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <div className="pagination">
          <button onClick={goToPreviousGroup} disabled={currentPage <= paginationGroupSize}>
            &lt;&lt;
          </button>
          {Array.from({ length: endPage - startPage + 1 }, (_, i) => {
            const pageNumber = startPage + i;
            return (
              <button
                key={pageNumber}
                className={`pagination-btn ${currentPage === pageNumber ? "active" : ""}`}
                onClick={() => paginate(pageNumber)}
              >
                {pageNumber}
              </button>
            );
          })}
          <button onClick={goToNextGroup} disabled={startPage + paginationGroupSize > totalPages}>
            &gt;&gt;
          </button>
        </div>
      </main>
    </div>
  );
};

export default Players;
